import Todos from './components/Todos'; 

import './App.css';

class App extends Component {


  render() {
    state = {
      todos : [
        { id : 1,
          title : 'Wash the dishes',
          completed: false
        },

      ]
    }



    return (
      <div className="App">
        <Todos /> 
      </div>
    );
  }
}

export default App;
